      case "paragraph":
        return <>{value}</>;

      case "UspCard":
        // No need for `await` if `value` is not a Promise
        return value.map((usp, index) => (
          <Col span={8} key={index}>
            <UspCard data={[usp, index]} />
          </Col>
        ));

      case "List":
        // No need for `await` if `value` is not a Promise
        return (
          <div style={{ width: "220px" }}>
            <Row
              style={{
                display: "flex",
                justifyContent: "start",
                alignItems: "start",
                width: "220px",
                fontSize: "12px",
              }}
            >
              {value.map((row, index) => (
                <>
                  <Row style={{ width: "20px", marginTop: "3px" }} key={index}>
                    <CheckCircleOutlined style={{ color: "green" }} />
                  </Row>
                  <Row style={{ width: "200px" }}>
                    <span style={{ color: "GrayText" }}>{row}</span>
                  </Row>
                </>
              ))}
            </Row>
          </div>
        );

      default:
        return <div>Unknown status.</div>; // Fallback for unknown types
    }
  };

  return (
    <div className="product-view">
      <div className="course-container">
        <div className="course-content">
          <div className="course-info">
            <Card
              title={
                <div>
                  <Row>
                    <Avatar
                      src="https://i.pinimg.com/564x/b9/90/b9/b990b9b5ea80ef423092bbe9bfd822ef.jpg"
                      size={100}
                      style={{
                        marginRight: "10%",
